Vriendinnen - S01E01 - 2014 - HDTV - 720p
-----------------------------------------

De achttienjarige Eva verhuist tegen haar zin naar een nieuwe stad. Ze is verlegen en legt niet makkelijk contacten. Wanneer ze haar buurmeisje Nel tegen het lijf loopt, is haar eerste oordeel: brutaal, vulgair en dom. Ze neemt zich voor om haar zo veel mogelijk te mijden...
